INSERT INTO `info` (`id`, `id_kategori`, `judul`, `isi`, `status`) VALUES
(1, 3, 'Badan Permusyawaratan Desa (BPD)', '<p>Badan Permusyawaratan Desa&nbsp;(<strong>BPD</strong>) merupakan lembaga perwujudan demokrasi dalam penyelenggaraan&nbsp;<a href=\"https://id.wikipedia.org/wiki/Desa\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Desa\">pemerintahan desa</a>. BPD dapat dianggap sebagai &quot;parlemen&quot;-nya desa. BPD merupakan lembaga baru di desa pada era otonomi daerah di Indonesia.</p>\r\n\r\n<p>Anggota BPD adalah wakil dari penduduk desa bersangkutan berdasarkan keterwakilan wilayah yang ditetapkan dengan cara musyawarah dan mufakat. Anggota BPD terdiri dari Ketua&nbsp;<a class=\"mw-redirect\" href=\"https://id.wikipedia.org/wiki/Rukun_Warga\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Rukun Warga\">Rukun Warga</a>, pemangku adat, golongan profesi, pemuka agama dan tokoh atau pemuka masyarakat lainnya. Masa jabatan anggota BPD adalah 6 tahun dan dapat diangkat/diusulkan kembali untuk 1 kali masa jabatan berikutnya. Pimpinan dan Anggota BPD tidak diperbolehkan merangkap jabatan sebagai Kepala Desa dan Perangkat Desa.</p>\r\n\r\n<p>Peresmian anggota BPD ditetapkan dengan Keputusan&nbsp;<a href=\"https://id.wikipedia.org/wiki/Bupati\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Bupati\">Bupati</a>/<a href=\"https://id.wikipedia.org/wiki/Wali_kota\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Wali kota\">Wali kota</a>, di mana sebelum memangku jabatannya mengucapkan sumpah/janji secara bersama-sama dihadapan masyarakat dan dipandu oleh Bupati/ Wali kota.</p>\r\n\r\n<p>Ketua BPD dipilih dari dan oleh anggota BPD secara langsung dalam Rapat BPD yang diadakan secara khusus. BPD berfungsi menetapkan&nbsp;<a class=\"mw-redirect\" href=\"https://id.wikipedia.org/wiki/Peraturan_Desa\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Peraturan Desa\">Peraturan Desa</a>&nbsp;bersama&nbsp;<a class=\"mw-redirect\" href=\"https://id.wikipedia.org/wiki/Kepala_Desa\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\" title=\"Kepala Desa\">Kepala Desa</a>, menampung dan menyalurkan aspirasi masyarakat.</p>\r\n\r\n<p><strong>Wewenang BPD antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li>Membahas rancangan peraturan desa bersama Kepala Desa</li>\r\n	<li>Melaksanakan pengawasan terhadap pelaksanaan Peraturan Desa dan Peraturan Kepala Desa</li>\r\n	<li>Mengusulkan pengangkatan dan pemberhentian Kepala Desa</li>\r\n	<li>Membentuk panitia pemilihan Kepala Desa</li>\r\n	<li>Menggali,menampung, menghimpun, merumuskan dan menyalurkan aspirasi masyarakat; dan</li>\r\n</ul>\r\n\r\n<p>Penggunaan nama/istilah BPD tidak harus seragam pada seluruh desa di Indonesia, dan dapat disebut dengan nama lain.</p>\r\n\r\n<p><strong>BPD mempunyai hak:</strong></p>\r\n\r\n<p>a. Meminta keterangan kepada Pemerintah Desa;</p>\r\n\r\n<p>b. Menyatakan pendapat.</p>\r\n\r\n<p><strong>Anggota BPD mempunyai hak:</strong></p>\r\n\r\n<p>a. Mengajukan rancangan Peraturan Desa;</p>\r\n\r\n<p>b. Mengajukan pertanyaan;</p>\r\n\r\n<p>c. Menyampaikan usul dan pendapat;</p>\r\n\r\n<p>d. Memilih dan dipilih; dan</p>\r\n\r\n<p>e. Memperoleh tunjangan.</p>\r\n\r\n<p><strong>KEANGGOTAAN</strong></p>\r\n\r\n<p>(1) Anggota BPD adalah wakil dari penduduk Desa yang bersangkutan berdasarkan keterwakilan wilayah yang ditetapkan dengan cara musyawarah dan mufakat;</p>\r\n\r\n<p>(2) Anggota BPD terdiri dari Ketua RT/RW, golongan profesi, pemuka agama dan tokoh atau pemuka masyarakat;</p>\r\n\r\n<p>(3) Anggota BPD setiap Desa berjumlah gasal dengan jumlah sesuai ketentuan yang berlaku;</p>\r\n', 1);
