(10, 'Sejarah', '<p>-</p>\r\n', '1'),
(11, 'Sambutan Kepala Dinas', '<p>-</p>\r\n', '1'),
(15, 'Visi dan Misi', '<p style=\"margin-left:27pt\"><span style=\"font-size:24px\"><strong>Visi&nbsp;&nbsp;&nbsp; : </strong></span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">Mewujudkan Badan Pendapatan Daerah sebagai pengelola pendapatan daerah yang unggul</span></p>\r\n\r\n<p style=\"margin-left:27.0pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:24px\"><strong>Misi&nbsp;&nbsp; : </strong></span></p>\r\n\r\n<p style=\"margin-left:27pt\">1. <span style=\"font-size:12px\">Meningkatkan integritas dan profesionalitas ASN Bapenda;</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">2. Meningkatkan kualitas pelayanan pada Bapenda;</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">3. Melaksanakan pengelolaan Pendapatan PBB-P2 dan BPHTB secara optimal;</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">4. Melaksanakan pengelolaan Pendapatan Pajak Daerah Lainnya secara optimal;</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">5. Melaksanakan pengelolaan Pasar secara optimal;</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">6. Melaksanakan Pengendalian, Pengembangan, Pembukuan dan Pelaporan dan Koordinasi Dana Perimbangan,</span></p>\r\n\r\n<p style=\"margin-left:27pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp; Retribusi Daerah Pendapatan Daerah Lainnya yang sah secara optimal.</span></p>\r\n', '1');
